pragma solidity ^0.6.12;

contract YourContract {
    uint8 public decimals = 0;
    uint256 public totalsupply = 300;
    uint256 public totalsold = 0;
    uint256 public price = 0xde0b6b3a7640000;
    string public name = "";
    string public symbol = "";
    address public owner;
    address payable public finance;
    address payable public jackpot;
    mapping (address => uint256) private balanceOf2;
    mapping (address => uint256) private balanceOf3;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;
    uint256 private totalSupply2 = 0;

    constructor() public payable {
        owner = msg.sender;
        finance = 0x28Dd611d5d2cAA117239bD3f3A548DcE5Fa873b0;
        jackpot = 0x119ea7f823588D2Db81d86cEFe4F3BE25e4C34DC;
        balanceof[address(this)] = 300;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(allowance[msg.sender][_spender] == 0 || _value == 0);
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    fallback() external payable {
        if (msg.value > 0) {
            totalSupply2 += msg.value / totalsupply;
        }
    }

    function setJackpot(address payable _newJackpot) public {
        require(msg.sender == owner);
        jackpot = _newJackpot;
    }

    function increaseProfit() public payable {
        if (msg.value > 0) {
            totalSupply2 += msg.value / totalsupply;
        }
    }

    function setFinance(address payable _newFinance) public {
        require(msg.sender == owner);
        finance = _newFinance;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        if (_value <= balanceof[_from] && _to != address(0) && _value > 0) {
            balanceof[_from] -= _value;
            balanceof[_to] += _value;
            if (_value != 0) {
                balanceOf2[_from] += totalSupply2 * _value;
                balanceOf3[_to] += totalSupply2 * _value;
            }
        }
        return true;
    }

    function withdraw() public {
        uint256 amount;
        if (totalSupply2 == 0) {
            amount = balanceOf2[msg.sender] - balanceOf3[msg.sender];
            if (amount > 0) {
                balanceOf3[msg.sender] += amount;
                msg.sender.transfer(amount);
            }
        } else {
            amount = balanceOf2[msg.sender] + balanceof[msg.sender] * totalSupply2 - balanceOf3[msg.sender];
            if (amount > 0) {
                balanceOf3[msg.sender] += amount;
                msg.sender.transfer(amount);
            }
        }
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(_to != address(0) && _value <= balanceof[msg.sender] && _value > 0);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        if (_value != 0) {
            balanceOf2[msg.sender] += totalSupply2 * _value;
            balanceOf3[_to] += totalSupply2 * _value;
        }
        return true;
    }

    function buy(uint256 _value) public payable {
        require(_value <= totalsupply - totalsold && _value <= balanceof[address(this)] && _value > 0);
        if (msg.value == 0 && _value == 0) {
            finance.transfer(0);
            if (msg.sender != address(0)) {
                balanceof[address(this)] -= _value;
                balanceof[msg.sender] += _value;
                jackpot.transfer(0);
                totalsold += _value;
            }
        }
        if (msg.value == price * _value && _value != 0) {
            finance.transfer((80 * price * _value) / 100);
            if (msg.sender != address(0)) {
                balanceof[address(this)] -= _value;
                balanceof[msg.sender] += _value;
                balanceOf2[address(this)] += totalSupply2 * _value;
                balanceOf3[msg.sender] += totalSupply2 * _value;
                jackpot.transfer((20 * price * _value) / 100);
                totalsold += _value;
            }
        }
    }
}
